import logo from './imgs/logo2.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCoffee, faHouseDamage } from '@fortawesome/free-solid-svg-icons';

const Header = () => {

    return (
        <header className='header'>
            <div className='logo'>
            <img src={logo}></img>
            </div>
            <div className = 'menu'>
            <FontAwesomeIcon icon={faHouseDamage} />
                <h3>Excursions</h3>
                <h3>Book</h3>
                <h3>Login</h3>
                <h3>Register</h3>
            <FontAwesomeIcon icon={faCoffee}/>
            </div>
        </header>
    )

}

export default Header
